import React from 'react';
import clients from '../data/clients';

function ClientList() {
  const allClients = clients.clients
  console.log(allClients)
  return (
    <div>
      <h1>Clientes Cadastrados</h1>
      { allClients.map(({ name }) => {
        return (
          <ul>
            <li>{ name }</li>
          </ul>
        )
      }) }
    </div>
  )
}

export default ClientList;
